    useEffect(() => {
        async function fetch() {
            await axios.post("http://localhost:4500/orderget")
                .then(resp => {
                    setdata(resp.data)
                    console.log(resp.data, "axios")
                    console.log(data)
                    setloading(false)

                }).catch(
                    error => console.log(error)
                )
        }

        fetch()
    }, []);



