                </div>

{data.map(e=> (<> <div className="ordercard"><div>{e.id}</div><div>{e.name}</div>  <img src={`/${e.image}`} className="orderimg"></img><div>{e.name}</div>

<div>{e.phone}</div><div>{e.address}</div>
</div></>) )}




